import { Container, Nav, Navbar } from "react-bootstrap";

import Avatar from "Shared/Avatar";
import { Link } from "react-router-dom";
import Logo from "./Logo";
import Message from "Images/speechBubbles.svg";
import React from "react";
import WalletIcon from "./WalletIcon";
import styled from "styled-components";
import Search from "Images/search.svg";
import Contract from "Images/document.svg";  


const Wrapper = styled(Container)`
  max-width: 1200px;
`;

const Brand = styled(Link)`
  flex-grow: 999;
`;

function RiseNav() {
  return (
    <Navbar expand="lg">
      <Wrapper>
        <Navbar.Brand as={Brand} to="/">
          {/* TODO: This can probably just become an <img /> and we can rework the Logo.jsx to be a logo.svg  */}
          <Logo />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link as={Link} to="/account" className="pl-auto pr-0 .order-lg-5" >
              <Avatar name="Justin Smith" size={34} className="d-none d-lg-inline" />
              <span className="d-lg-none">User Name</span>
            </Nav.Link>
            <Nav.Link href="/home" className="d-lg-none 



.order-lg-4">
              Home
            </Nav.Link>
            <Nav.Link href="/search">
              {/* TODO: Replace this with the correct. Search not present on mobile */}
              <img src={Search} alt="Search" className="d-none d-lg-inline " />
              <span className="d-none d-lg-none">Search</span>
            </Nav.Link>
            <Nav.Link as={Link} to="/contracts" className=".order-lg-2">
              {/* TODO: Replace this with the correct.*/}
              <img src={Contract} alt="Contracts" className="d-none d-lg-inline" />
              <span className="d-lg-none">Contracts</span>
            </Nav.Link>
            <Nav.Link as={Link} to="/project" className=".order-lg-1">
              {/* TODO: Replace this with the correct.*/}
              <img src={Message} alt="Message" className="d-none d-lg-inline" />
              <span className="d-lg-none">Projects</span>
            </Nav.Link>
            <Nav.Link as={Link} to="/wallet .order-lg-3">
              <WalletIcon />
              <span className="d-lg-none">Wallet</span>
            </Nav.Link>

          </Nav>
        </Navbar.Collapse>
      </Wrapper>
    </Navbar>
  );
}

export default RiseNav;
